import React from "react";
import "./Footer.css";
import images from "../../constant/images";
const Footer = () => {
  return (
    <div className="footer_main">
      <div>
        <img src={images.plastapslogo} className="plastaps_logo" />
      </div>
      <div>
        <img src={images.GPlaystore} />
      </div>
    </div>
  );
};

export default Footer;
